import React from 'react';

import { Col, Container, Row } from 'react-bootstrap';
interface Props {
    [key: string]: any;
    // onChange: (e:ChangeEvent<HTMLInputElement>) => void
};

const formList = (props: Props): JSX.Element => {
    const lista = [
        {
          id: 'a',
          firstname: 'Robin',
          lastname: 'Wieruch',
          year: 1988,
        },
        {
          id: 'b',
          firstname: 'Dave',
          lastname: 'Davidds',
          year: 1990,
        },
      ];
    return <>
        <section>
            <Container>
                <Row>
                    <Col xs lg="4">
                        Form
                        <form>
                            <label>
                            <input type="text" name="nome" />
                            </label>
                            <input type="submit" value="Submit" />
                        </form>
                    </Col>
                    <Col xs lg="4" >
                        Lista
                        <ul>
                            {lista.map((item, b) => (
                                <li key={b}>{item}</li>
                            ))}
                        </ul>
                    </Col>
                </Row>
            </Container>
        </section>
    </>
}

export default formList
